script: |
  super -f text -I q12538.spq | sort > q12538.out

inputs:
  - name: q12538.spq
    data: |
      SELECT col1, + 23 + 67 AS col1 FROM tab2 (FORMAT parquet) cor0 WHERE col0 + + ( + col2 ) NOT BETWEEN + - col1 AND - col0;
  - name: tab2

outputs:
  - name: q12538.out
    data: |
      51	90
      67	90
      77	90
